import { SpinnerOverlay, SpinnerContainer } from './with-spiner.styles';


const WithSpinner = WrapedComponent => {
    const Spinner = (isLoading, ...otherProps) => {
        return isLoading ? (
            <SpinnerContainer>
                <SpinnerOverlay />
            </SpinnerContainer>
        ) : (
                <WrapedComponent {...otherProps} />
            )
    };
    return Spinner;
};

export default WithSpinner;
